import React from 'react'
import {Container, Button, Image} from 'react-bootstrap';
import { About } from './About';
import { Work } from './Work';
import ImageTest from '../Images/steinar-engeland-SgyH_Ix9lNE-unsplash.jpg';

import './Home.css';

export const Home = () => (
    <div>
        <section id="home" className=''>
            <div className='hero'>
                <div className='text-white hero-overlay'>
                    <h1 className='mb-3'>Thomas Bach-Nilsen</h1>
                    <h5 className='mb-4'>Front-End Developer</h5>
                    <a
                        className='btn btn-outline-light btn-lg m-2'
                        href="https://www.youtube.com/watch?v=c9B4TPnak1A"
                        role="button"
                        rel="nofollow"
                        target="_blank">Check out my work</a>
                </div>
                    {newFunction()}
            </div>
        </section>
        <About />
        <Work />

    </div>
)







function newFunction() {
    return <Image className='hero-image' src={ImageTest}></Image>;
}
